export const THUMP_BEGIN = 'THUMP_BEGIN'; export const THUMP_SUCCESS = 'THUMP_SUCCESS'; export const THUMP_FAIL = 'THUMP_FAIL'


export const thumpBegin = () =>{
    return {
        type: THUMP_BEGIN 
    }
}


export const thumpSuccess = (thumpData) =>{
    return {
        type: THUMP_SUCCESS,
        payload: thumpData
    }
}


export const thumpFail = (error) =>{
    return {
        type: THUMP_FAIL,
        payload: error
    }
}
